import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  background-color: #000;
  color: #fff;
  text-align: center;
  padding: 50px 20px;
`;

const Title = styled.h2`
  font-size: 2.5em;
  margin: 0;
`;

const Subtitle = styled.p`
  font-size: 1.5em;
  margin: 10px 0;
`;

const CustomizationIcons = styled.div`
  display: flex;
  justify-content: center;
  gap: 10px;
  margin-top: 30px;
`;

const Icon = styled.img`
  width: 40px;
  height: 40px;
`;

const CustomizationSection = () => {
  return (
    <Container>
      <Title>Countless ways to customize.</Title>
      <Subtitle>
        Customization is at the core of the Sleeve experience â€” choose from any combination of design choices, behaviors and themes to make Sleeve at home on your desktop.
      </Subtitle>
      <CustomizationIcons>
        <Icon src={require('../Images/Icon1.png')} alt="Icon 1" />
        <Icon src={require('../Images/Icon2.png')} alt="Icon 2" />
        <Icon src={require('../Images/Icon3.png')} alt="Icon 3" />
        <Icon src={require('../Images/Icon4.png')} alt="Icon 4" />
        <Icon src={require('../Images/Icon5.png')} alt="Icon 5" />
        <Icon src={require('../Images/Icon6.png')} alt="Icon 6" />
        <Icon src={require('../Images/Icon7.png')} alt="Icon 6" />
        <Icon src={require('../Images/Icon6.png')} alt="Icon 6" />
        <Icon src={require('../Images/Icon6.png')} alt="Icon 6" />
      </CustomizationIcons>
    </Container>
  );
};

export default CustomizationSection;
